import axios from 'axios'


const api = axios.create({
    baseURL: 'http://localhost:4000',
    withCredentials: true,
    headers: {
        "Content-Type": "application/json",
    }
})

const sigup = async (data)=>
{
    let response;
    try{
        response = await api.post("/create",data)
    }
    catch(error){
        return error;
    }
    return response;
}
export default sigup;
